Antenna ( Figs 18 , 19 ,
21
) with radicle 0.27–0.35 × total length of scape, rest of scape 2.5–2.9 × as long as wide, faintly striate; pedicel a little longer than F 1 ; F 2 longer than F 1 and following funicle segments (but sometimes F 2 about as long as F 3 ); F 1 –F 6 almost always without mps except very rarely either F 3 with 1 mps (in one aberrant non-type specimen only) or F 6 apparently with 1 mps on one antenna only [as in the holotype of L.

Mesosoma ( Figs 18 , 23 ). Propodeum (
Fig. 22
) with submedian lines more or less distinct. Fore wing ( Figs 18 , 20 ,
24
) 3.6–3.8 × as long as wide; longest marginal seta 0.33–0.4 × maximum wing width. Fore wing disc infumate throughout, setose from about middle of submarginal vein and beyond. Hind wing (
Fig. 18
) 22–26 × as long as wide; disc mostly bare except for rows of setae along margins and a few additional setae; longest marginal seta 3.1–3.3 × maximum wing width.

Metasoma (
Fig. 23
). Metasoma with petiole wider than long. Ovipositor 0.7–0.8 × length of gaster, not exserted beyond its apex; ovipositor length: mesotibia length ratio 1.1–1.4 : 1 .
